set charset utf8;
DROP TABLE IF EXISTS `order_activity`;
CREATE TABLE `order_activity` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(60) NOT NULL,
  `activity_id` int(10) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=518 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order_discount`;
CREATE TABLE `order_discount` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(60) NOT NULL,
  `type` tinyint(1) unsigned NOT NULL COMMENT '0:美积分;1:优惠券',
  `coupon_user_id` int(10) unsigned NOT NULL,
  `amount` decimal(20,2) unsigned NOT NULL,
  `status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=735 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order_history`;
CREATE TABLE `order_history` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `num` mediumint(8) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=175 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order_item`;
CREATE TABLE `order_item` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sn` varchar(30) NOT NULL,
  `supplier_id` int(10) unsigned NOT NULL,
  `order_id` varchar(60) NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `item_id` int(10) unsigned NOT NULL,
  `item_name` varchar(255) NOT NULL,
  `image` text NOT NULL,
  `cost_price` decimal(20,2) unsigned NOT NULL,
  `price` decimal(20,2) unsigned NOT NULL,
  `num` mediumint(8) unsigned NOT NULL,
  `available_num` mediumint(8) NOT NULL,
  `spec_desc` varchar(255) NOT NULL,
  `use_time` tinyint(10) NOT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '状态（-1:过期;0:无效;1:有效;2:已使用）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=36474 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order_log`;
CREATE TABLE `order_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(60) NOT NULL,
  `operator_id` int(10) NOT NULL,
  `desc` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=79388 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order_shipping`;
CREATE TABLE `order_shipping` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `order_id` varchar(60) NOT NULL,
  `type` tinyint(1) unsigned NOT NULL,
  `shipping_company` varchar(60) NOT NULL,
  `company_no` varchar(30) NOT NULL,
  `shipping_no` varchar(60) NOT NULL,
  `memo` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17395 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `pay_notify`;
CREATE TABLE `pay_notify` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:支付宝 2:微信支付',
  `rid` int(10) unsigned NOT NULL,
  `oid` varchar(255) NOT NULL,
  `order_id` varchar(200) NOT NULL,
  `info` text NOT NULL,
  `error_msg` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `rstatus` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=776 DEFAULT CHARSET=utf8;
