DROP TABLE IF EXISTS `position`;
CREATE TABLE `position` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `group_id` mediumint(8) unsigned NOT NULL,
  `position_name` varchar(30) NOT NULL,
  `memo` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=66 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `position_data`;
CREATE TABLE `position_data` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `position_id` int(10) unsigned NOT NULL,
  `cate_id` int(10) unsigned NOT NULL,
  `data_type` varchar(30) NOT NULL,
  `title` varchar(90) NOT NULL,
  `image` text NOT NULL,
  `params` text NOT NULL,
  `order` tinyint(2) unsigned NOT NULL DEFAULT '100' COMMENT '排序',
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1471 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `position_group`;
CREATE TABLE `position_group` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(30) NOT NULL,
  `status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `area` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `cate_id` int(10) unsigned NOT NULL,
  `brand_id` int(10) unsigned NOT NULL,
  `supplier_id` int(10) unsigned NOT NULL,
  `seller_id` int(10) unsigned NOT NULL,
  `product_name` varchar(90) NOT NULL,
  `sn` varchar(60) NOT NULL,
  `art` varchar(30) NOT NULL,
  `image` varchar(255) NOT NULL,
  `price` decimal(20,2) unsigned NOT NULL,
  `prices` text NOT NULL,
  `price_range` varchar(30) NOT NULL,
  `mktprice` decimal(20,2) unsigned NOT NULL,
  `pcs` tinyint(1) unsigned NOT NULL,
  `extra` text NOT NULL,
  `detail` text NOT NULL,
  `stock` mediumint(8) unsigned NOT NULL,
  `title` varchar(255) NOT NULL,
  `keywords` varchar(255) NOT NULL,
  `desc` varchar(255) NOT NULL,
  `a_0` varchar(2) NOT NULL,
  `a_1` varchar(2) NOT NULL,
  `a_2` varchar(2) NOT NULL,
  `a_3` varchar(2) NOT NULL,
  `a_4` varchar(2) NOT NULL,
  `a_5` varchar(2) NOT NULL,
  `a_6` varchar(2) NOT NULL,
  `a_7` varchar(2) NOT NULL,
  `a_8` varchar(2) NOT NULL,
  `a_9` varchar(2) NOT NULL,
  `a_10` varchar(2) NOT NULL,
  `weight` mediumint(8) unsigned NOT NULL,
  `views` mediumint(8) unsigned NOT NULL,
  `sells` mediumint(8) unsigned NOT NULL,
  `up_time` int(10) unsigned NOT NULL,
  `down_time` int(10) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL COMMENT '-1:删除;0:待审核;1:待上架;2:上架中;3:已下架',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3402 DEFAULT CHARSET=utf8;
2、邮轮行程中所列航班号、时间、岸上观光行程内容及邮轮抵离时间仅供参考，将根据实际情况做出合理的调整，请以给您的确认出团通知书为准，严格遵守时间结点集合，因游客自身原因导致误机、误船，所有费用我社恕不退还。
3、不接受不满 6 个月的婴儿，怀孕24周以上的游客报名。70周岁以上(含70周岁)的游客需提供境内三甲医院3个月内的健康证明，18周岁以下和80周岁以上的游客需同时有家属陪同，85周岁以上老人或其余特殊人群需评估适游状况后方可报名。 
4、是否给予签证、是否准予出、入境，为有关机关的行政权利。如因您自身原因或因提供材料存在问题不能及时办理签证而影响行程的，以及被有关机关拒发签证或不准出入境的，相关责任和费用由您自行承担。如果您已自备签证，请务必提供有效护照及签证复印件，用于核对姓名和签证有效期。如因如因自备签证问题造成行程受阻，相应损失需自行承担。
5、根据大使馆规定，全体团员在境外须按行程活动，一律不得脱（离）团活动。如擅自脱（离）团，需赔偿我社每人每天的脱团损失费（具体费用现询），并自行承担脱团期间所发生的人身及财产意外以及由此产生的其他任何问题和责任。脱团期间产生的所有意外、问题及责任，我社一律不予承担。
6、在下列情况下，船长有权自行对航行范围作出修改、变更停靠港口的顺序和/或省略其中某个或某些停靠港口：1）因不可抗力或其他超过船长或船主的控制范围的情形；2）为了旅客和邮轮的安全性而有必要的；3）为了使邮轮上的任何人获得岸上医疗或手术治疗；4）任何其他可能发生的紧急情况，包括因特殊情况引起的燃料问题，船长的决定是最终决定。
7、在出发前或航程期间，邮轮公司有权根据天气、战争、罢工等不可抗力因素调整或改变行程，对此我司将不承担任何赔偿责任。若因不可抗力导致航线取消，我司将退还全部票款，但不承担赔偿责任。
8、当旅客不适合开始或继续航行，或可能对船上的健康，安全，纪律造成危险的，船长有权利在任何时候，视情况作出任何以下决定： 1） 拒绝该旅客登船；2）在任意港口让该旅客下船；3）拒绝该旅客在任何特定港口下船；4）限制该旅客在邮轮的特定区域或拒绝该旅客参与船上的某些活动。
9、邮轮上的货币结算方式：皇家加勒比邮轮按美金计算。
10、当地购物时请慎重考虑，把握好质量与价格；涉及退税商品，请在领队的指引下完成退税手续，未及时退税或部分商品未退税，我社概不负责协调办理。
11、走团过程中如发生客人损坏餐厅用品或其他公共设施的情况时，由客人自行赔偿及承担法律责任。
12、出团时务必带上身份证原件，无身份证者带户口本原件，因个人证件不全所造成损失客人自行承担。因客人自身原因导致不能出入中国海关，则所有费用恕不退还。
13、建议购买境外旅游意外保险；行程中自行保护人身及财产安全，在逛街，自由活动以及旅游项目结束下团后，出现人身及财产意外、损失，由客人自行承担。
