【签证信息】法国签证\";s:11:\"refund_desc\";s:481:\"在无实际损失的前提下，在行程前解除合同的，必要的费用扣除标准为：行程前30日至15日，收取旅游费用总额2％的违约金。行程前14日至7日，收取旅游费用总额5％的违约金。行程前6日至4日，收取旅游费用总额10％的违约金。行程前3日至1日，收取旅游费用总额15％的违约金。行程开始当日，收取旅游费用总额20％的违约金。如有实际损失，则按照实际损失收取。\";s:6:\"notice\";s:6270:\"一、签证材料问题：请务必保证出游人资料的真实性，报名后因材料不真实不予送签退团，客户自行承担旅行社发生的损失。目前赴欧洲旅游担保金通常为5万至20万，视材料情况提供相关担保金和担保函，若游客无法按照要求提供相应保证金，我社有权单方面解约，产生的费用由游客承担。在办理签证期间，可为提高出签率，能会根据您的材料情况要求增补其他材料，敬请配合。若游客无法提供足够的证明材料，将做劝退处理，已产生的费用损失由游客承担。二、行程脱团问题：申根旅游签证(ads)随团进出,不允许擅自离团，三、面签、销签问题：欧洲使馆可能要求客人参加面试(送签和销签)，产生的费用由客人自理。如被抽查面试，客人必须去领馆配合工作，如因客人不配合领馆工作而产生的损失，由客人承担。销签时间通常在15-20个工作日左右，此期间护照均在领馆，注意自己回国后的其他出境安排。四、自备签情况说明：若游客是自己准备的签证（商务签证/个人旅游签证等非团队旅游签证）跟团游，请自行确认是否顺利出入海关。因自备签导致的无法出入海关，已产生的费用有客人自行承担。五、收客限制问题：70周岁以上老年人，需购买人身意外险，同时提供由三甲医院开具的近期体检单，无法接待80周岁以上和18周岁以下旅游者单独报名出游。儿童价不含早餐，酒店不占床。（备注：80岁以上老人、孕妇、聋哑人、其他残疾人等特殊人群单议）六、欧洲酒店问题：欧洲酒店星级多为网评酒店，同级酒店差于我国；欧洲团队酒店一般在城外35公里至100公里处，旺季酒店不会安排在城内。欧洲部分酒店没有电梯，部分酒店因为地方特性，酒店不提供棉被、空调等设施。七、单房差问题：团队按不产生单男单女的原则分房，在不影响团队分房原则的前提下安排夫妻一间房，散拼团队因单男单女问题可能产生夫妻、亲属、朋友等不同房，请予以谅解和配合，在预时请提前告知住宿安排情况(例如：单男或单女拼房/2人一间/单间补房差等)，若单人要求享受单房（一张床）请补房差。 八、欧洲用车问题：车辆在停车状态时启动引擎在欧洲是违法的行为，因此可能导致车内温度较高。旺季接待能力有限可能房间和大巴车没有空调。根据欧共体法律规定，导游和司机每天工作时间不得超过10小时。九、不可抗力因素：如遇当地公共假期、宗教节日、气候状况、罢工等不可抗力，上述行程次序及景点可能临时变动、修改或更换，亦有权缩短或延长旅程。而所引发之额外支出或损失，概与本公司无责，团员不得借故反对或退出。十、关于购物：若游客在不属于旅游定点购物店在此类购物店所购买的商品出现质量问题，旅行社不承担任何责任。十一、关于退税：作为居住在欧盟以外的游客，您有权申请退还您在欧洲购买且带离欧盟商品的增值税/消费税。由于各商店退税程序和退税率不同，最好向您购买商品的商店询问清楚，并索取相关票据。1.     购物退税三步曲：a)     在有Tax Free Shopping(退税购物)标志的商店购物，并索要您的退税支票(Refund Cheque) ；b)     盖章：出境时，出示您购买的商品，收据和护照，以便取得退税支票上的海关章；c)     获得退税。2.     退税提示：a)     欧洲购物退税是游客的个人权利，领队或导游只能协助您检查退税表格，但是对此并不承担任何责任。如果遇到海关罢工、工会开会或其他各种无法预知的情况，未能获得海关敲章等，最终导致游客无法成功退税的，我公司不承担任何责任，敬请见谅；b)     在
法国巴黎春天或者老佛爷百货公司购物，可以在相应商店内设的退税窗口选择以信用卡做担保（商店会收取一定金额的手续费），当场获得所退现金税款。但是，选
择此类退税方法的游客必须在欧盟机场出关时将盖有退税章及海关确认章的退税表格回执寄送回退税公司。特别注意，无论何种情况，若退税公司未收到盖章的退税
表格（哪怕是因为邮寄遗失），退税公司都有权从您的信用卡中扣除此笔税款。所以，我公司建议慎重选择退税方式，尽量选择在机场盖章后现场现金退税（无需信
用卡做担保）。 十二、行程价格说明：所
有牵涉到的机票、酒店、用餐、景点门票等除特别说明的价格外均为一体价格，不得拆分。若遇境外景点、火车等对青少年、老人优惠或者免费，均不在此列，无法
退费。行程中所安排之机票/船票/车票/酒店或观光项目，均属团体订位，一经出发前确认及订购后，不论任何情况下而未能使用者，概不退回任何款项。 十三、特殊行程说明：特价班期，一经预定，取消全损。因客户自身原因，提供虚假资料，全款损失。该损失由客户自行承担。十四、联运须知：联运航班，具体联运时间皆以航空公司批复为准，一经申请不可取消必须乘坐，如果首段联运不坐，之后的国际段将无法乘坐（航空公司原因），导致的损失由客人自行承担，若因联运导致无法赶上国际段，产生的损失由客人自行承担。我司会协助客人与航空公司争取赔偿。  备注：以上不包括包机项目，或者其他特殊项目另议！如客人持非中国护照在国内参团往返，请自行确认团队返回时能再次入中国境内；如客人持港澳护照，必须携带回乡证原件；如客人持台湾护照，必须携带台胞证原件；否则后果由客人承担；我公司保留因航空公司航班调整、签证以及不可抗力等因素推迟或调整出发日期及行程的权利。  请将担保函打印下来，与材料一起交给供应商，谢谢！！！\";}','<img src=\\\"/static/data/image/2016/04/16/14262332762.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/14305826582.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/1431004618.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/14310011199.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/14310216866.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/14310370228.jpg\\\" alt=\\\"\\\" /><img src=\\\"http://www.zhongyouwl.com/static/data/image/2016/04/16/1431034673.jpg\\\" alt=\\\"\\\" />','218','','','','','','','','','','','','','','','9525','205','2','1460736000','1464624000','1460788292','2');
