二、中国出境每人可携带人民币20000元，美金5000元（或折合美金5000元的其他外币），一条烟（200支）和两瓶酒，贵重物品如超过5000元的专业照相机、摄像机、手提电脑等需向海关申报。
三、美国海关检查非常严格，严禁携带新鲜水果、肉类和违禁品、动植物；超过100ML的液体必须托运。携带超额货币美金10000元以上必须申报。美国是无外汇管制国，人民币不可在美国兑换美元。方便起见，在美国请使用美元。
四、美国国内航班托运行李需支付费用，具体收费标准以各航空公司柜台为准，美国国内航班不提供免费餐食，请自备干粮。
五、美洲无统一的酒店星级评定标准，且不保证房型。我社提供酒店星级参考相当于国内该星级的酒店标注。根据国际惯例，酒店入住时间均在下午14：00-15：00之后。北美城市地广人稀，常规团队酒店周围并无繁华的街道和社区。且酒店楼层普遍偏低，酒店大堂比较少，很多电梯每次只能容纳两个人和两件行李，甚至很多酒店没有电梯。美国酒店内不提供洗漱用具，请自备洗漱用品（牙膏、牙刷等）及拖鞋。一般酒店采用110伏特，如手机照相机充等，可备&ldquo;美标&rdquo;转换插头。
六、美国自来水可以安全饮用，但水龙头热水不可饮用，饭店客房内不直接提供热开水。
七、美国为纳税国家，全美购物及餐厅用餐均须交纳税金，各洲税率不同。
八、欧美人习惯简单的早餐，行程中所列酒店内早餐或者打包早餐，通常只有面包、咖啡、茶水等冷早；午晚餐为西式自助餐和中式桌餐穿插安排；中式桌餐为根据人数安排8-10人一桌六菜一汤）。
九、根据美联邦法律规定，导游和司机每天工作时间不得超过10小时；如有超时，须自行支付加班费。
十、美国机场、商店、餐厅等公共场所基本上全部禁烟，下榻的酒店房间内基本也都禁烟(在无烟房吸烟，将罚款 $250/每间房以上)，客人可在室外规定地区抽烟。 
