DROP TABLE IF EXISTS `product_brand`;
CREATE TABLE `product_brand` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `brand_name` varchar(90) NOT NULL,
  `image` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=75 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_brandtype`;
CREATE TABLE `product_brandtype` (
  `brand_id` int(10) unsigned NOT NULL,
  `type_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`brand_id`,`type_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_cate`;
CREATE TABLE `product_cate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `area` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `parent_id` int(10) unsigned NOT NULL,
  `type_id` int(10) unsigned NOT NULL,
  `level` int(1) unsigned NOT NULL,
  `cate_name` varchar(90) NOT NULL,
  `image` text NOT NULL,
  `children` mediumint(8) unsigned NOT NULL,
  `display` tinyint(1) unsigned NOT NULL,
  `order` tinyint(1) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=419 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_feedback`;
CREATE TABLE `product_feedback` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `account` varchar(30) NOT NULL,
  `avatar` text NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `grade` decimal(2,1) unsigned NOT NULL,
  `content` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7581 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_image`;
CREATE TABLE `product_image` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `image` text NOT NULL,
  `order` tinyint(2) NOT NULL,
  `main` tinyint(1) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=15847 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_item`;
CREATE TABLE `product_item` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` int(11) unsigned NOT NULL,
  `area` tinyint(1) unsigned NOT NULL,
  `specval_1` varchar(30) NOT NULL,
  `specval_2` varchar(30) NOT NULL,
  `specval_3` varchar(30) NOT NULL,
  `item_name` varchar(255) NOT NULL,
  `image` text NOT NULL,
  `art` varchar(60) NOT NULL,
  `fn` varchar(60) NOT NULL,
  `price` decimal(20,2) unsigned NOT NULL,
  `cost_price` decimal(20,2) unsigned NOT NULL,
  `mktprice` decimal(20,2) unsigned NOT NULL,
  `stock` mediumint(8) unsigned NOT NULL,
  `spec_desc` varchar(255) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `NewIndex1` (`product_id`),
  KEY `fn` (`fn`,`specval_1`,`specval_2`)
) ENGINE=MyISAM AUTO_INCREMENT=47725 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_spec`;
CREATE TABLE `product_spec` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `spec_name` varchar(60) NOT NULL,
  `memo` varchar(255) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_specval`;
CREATE TABLE `product_specval` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `spec_id` mediumint(8) unsigned NOT NULL,
  `value` varchar(30) NOT NULL,
  `letter` varchar(30) NOT NULL,
  `memo` varchar(30) NOT NULL,
  `image` text NOT NULL,
  `order` tinyint(2) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=171212 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_tag`;
CREATE TABLE `product_tag` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `tag_name` varchar(60) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_tagdata`;
CREATE TABLE `product_tagdata` (
  `tag_id` int(10) unsigned NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`tag_id`,`product_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `product_type`;
CREATE TABLE `product_type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type_name` varchar(255) NOT NULL,
  `attrs` text NOT NULL,
  `params` text NOT NULL,
  `minfo` text NOT NULL,
  `spec_1` int(10) unsigned NOT NULL,
  `spec_2` int(10) unsigned NOT NULL,
  `spec_3` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `region`;
CREATE TABLE `region` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `package` varchar(255) NOT NULL,
  `parent_id` int(10) unsigned NOT NULL,
  `level` tinyint(3) unsigned NOT NULL,
  `region_name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `parent` (`parent_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3267 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `scrath`;
CREATE TABLE `scrath` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `scrath_name` varchar(45) NOT NULL COMMENT '活动名称',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `end_time` int(11) NOT NULL COMMENT '结束时间',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '是否开启 0否 1是',
  `draw_amount` decimal(10,2) NOT NULL COMMENT '抽奖金额',
  `add_time` int(11) NOT NULL COMMENT '添加时间',
  `total_num` int(11) NOT NULL COMMENT '总数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='刮刮卡活动表';
DROP TABLE IF EXISTS `scrath_card`;
CREATE TABLE `scrath_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `scrath_order_id` varchar(60) NOT NULL COMMENT '刮刮卡订单id',
  `scrath_id` int(11) unsigned NOT NULL COMMENT '刮刮卡活动id',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '刮刮卡状态',
  `add_time` int(11) unsigned NOT NULL COMMENT '添加时间',
  `use_time` int(11) unsigned NOT NULL COMMENT '使用时间',
  `is_prize` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否中奖',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1695 DEFAULT CHARSET=utf8 COMMENT='用户刮刮卡表';
DROP TABLE IF EXISTS `scrath_order`;
CREATE TABLE `scrath_order` (
  `id` varchar(60) NOT NULL,
  `member_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `to_member_id` int(11) NOT NULL COMMENT '商家id',
  `scrath_id` int(11) NOT NULL COMMENT '活动刮刮卡id',
  `total_money` decimal(10,2) NOT NULL COMMENT '总金额',
  `pay_time` int(10) NOT NULL COMMENT '付款时间',
  `add_time` int(10) NOT NULL COMMENT '添加时间',
  `subject` varchar(90) NOT NULL,
  `body` varchar(255) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '订单状态  0未支付 1 已支付',
  `is_card` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '是否获取过刮刮卡  0否 1 是',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='刮刮卡记订单表';
DROP TABLE IF EXISTS `scrath_prize`;
CREATE TABLE `scrath_prize` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `product_id` int(11) NOT NULL,
  `scrath_card_id` int(11) NOT NULL COMMENT '刮刮卡id',
  `add_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  `phone` varchar(145) NOT NULL COMMENT '收货人电话',
  `consignee` varchar(100) NOT NULL COMMENT '收货人姓名',
  `address` text NOT NULL COMMENT '详细地址',
  `is_deliver` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否发货 0 否1是',
  `invoice_number` varchar(145) NOT NULL COMMENT '发货单号',
  `express` varchar(145) NOT NULL COMMENT '快递公司',
  `remarks` text NOT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=523 DEFAULT CHARSET=utf8 COMMENT='刮刮卡中奖信息表';
DROP TABLE IF EXISTS `scrath_product`;
CREATE TABLE `scrath_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `scrath_id` int(11) unsigned NOT NULL COMMENT '活动id',
  `product_name` varchar(45) NOT NULL COMMENT '商品名字',
  `image` text NOT NULL COMMENT '图片',
  `product_level` varchar(145) NOT NULL COMMENT '商品等级',
  `total_num` mediumint(8) NOT NULL COMMENT '剩余商品数量',
  `stock` mediumint(8) NOT NULL COMMENT '库存',
  `status` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='活动商品表';
DROP TABLE IF EXISTS `search_count`;
CREATE TABLE `search_count` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `words` varchar(60) NOT NULL,
  `count` mediumint(8) unsigned NOT NULL,
  `last_user` int(10) unsigned NOT NULL,
  `last_time` int(10) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2512 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `session`;
CREATE TABLE `session` (
  `id` char(32) NOT NULL,
  `name` varchar(32) NOT NULL,
  `save_path` varchar(32) NOT NULL,
  `data` text NOT NULL,
  `modified` int(10) unsigned NOT NULL,
  `life_time` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`,`name`,`save_path`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `system_config`;
CREATE TABLE `system_config` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` mediumint(8) unsigned NOT NULL COMMENT '父ID',
  `field` varchar(60) NOT NULL COMMENT '字段名',
  `value` varchar(60) NOT NULL COMMENT '值',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `system_shippingtpl`;
CREATE TABLE `system_shippingtpl` (
  `privince_id` mediumint(8) unsigned NOT NULL,
  `fee` decimal(20,2) unsigned NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `vote`;
CREATE TABLE `vote` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `vote_name` varchar(60) NOT NULL,
  `image` text NOT NULL,
  `intro` varchar(255) NOT NULL,
  `awards` text NOT NULL,
  `rule` text NOT NULL,
  `vote_btn` varchar(30) NOT NULL COMMENT '投票按钮',
  `limit_sumnum` tinyint(1) unsigned NOT NULL,
  `limit_daynum` tinyint(1) unsigned NOT NULL,
  `limit_dayonenum` tinyint(1) unsigned NOT NULL,
  `start_time` int(10) NOT NULL,
  `end_time` int(10) NOT NULL,
  `vstart_time` int(10) NOT NULL,
  `vend_time` int(10) NOT NULL,
  `view_count` mediumint(8) unsigned NOT NULL,
  `rank_num` mediumint(8) unsigned NOT NULL,
  `player_auth` tinyint(1) unsigned NOT NULL,
  `comment_auth` tinyint(1) NOT NULL,
  `day_auth` tinyint(1) unsigned NOT NULL COMMENT '24小时验证 0不需要1需要',
  `allow_post` tinyint(1) unsigned NOT NULL COMMENT '1.允许报名',
  `subscribe` tinyint(1) unsigned NOT NULL COMMENT '1.需要关注 0.不需要关注',
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;
